import React from 'react';
import './MarkBtn.css';

const MarkBtn =  ({ clickedTask, toggleTaskComplete }) => {
    var complete = clickedTask.complete;

    if (complete == 0 ){
        return(
            <div>
                <button>Mark complete</button>
            </div>
        )
    }
}

export default MarkBtn;
